@media only screen and (max-width: 768px) {
  #burger-menu {
    cursor: pointer;
    margin: 3em;
    overflow: visible;
    position: fixed;
    z-index: 2;
  }

  #burger-menu span,
  #burger-menu span:before,
  #burger-menu span:after {
    background: $light-font;
    height: 0.2em;
    opacity: 1;
    position: absolute;
    transition: 0.3s ease-in-out;
  }

  #burger-menu span:before,
  #burger-menu span:after {
    content: "";
  }
  #burger-menu span {
    right: 0;
    top: 1em;
    width: 1em;
  }
  #burger-menu span:before {
    left: 0;
    top: -0.7em;
    width: 1.3em;
  }
  #burger-menu span:after {
    left: 0;
    top: 0.7em;
    width: 1.3em;
  }

  #burger-menu.close span {
    transform: rotate(-45deg);
    top: 0.8em;
    width: 1.7em;
  }
  #burger-menu.close span:before {
    top: 0;
    transform: rotate(90deg);
    width: 1.7em;
  }
  #burger-menu.close span:after {
    top: 0;
    left: 0;
    transform: rotate(90deg);
    opacity: 0;
    width: 0;
  }

  #menu {
    z-index: 1;
    min-width: 100%;
    min-height: 100%;
    position: fixed;
    top: 0;
    height: 0;
    visibility: hidden;
    opacity: 0;
    transition: all 0.3s ease-in-out;
    text-align: center;
    display: block;

    li {
      list-style: none;
    }
    a {
      color: $light-font;
      display: inline-block;
      font-size: 2em;
      margin-bottom: 2em;
      text-decoration: none;

      justify-content: center;

      transition: transform 250ms ease-in-out;
      position: relative;

      &::after {
        position: absolute;
        content: "";
        transition: width 0.3s;
        bottom: 0;
        left: 0;
        width: 0;
      }

      &:hover::after {
        width: 100%;
        transform: scaleX(1);
        border-bottom: 1px $light-font solid;
      }
    }
  }

  #menu.overlay {
    visibility: visible;
    opacity: 1;
    padding-top: 6em;
    background: rgba(24, 24, 24, 0.829);
  }
}

