}

#flip-container {
  position: relative;
  margin: 0 auto;
  width: 500px;
  height: 500px;
  z-index: 1;

  perspective: 1000;

  #flip-card {
    width: 100%;
    height: 100%;
    transform-style: preserve-3d;
    transition: all 0.7s linear;
  }

  &:hover #flip-card {
    transform: rotateY(180deg);
  }

  .face {
    position: absolute;
    width: 100%;
    height: 100%;
    backface-visibility: hidden;
  }

  .face.back {
    position: relative;
    display: block;
    transform: rotateY(180deg);
    box-sizing: border-box;
    padding: 1em;
    color: $light-font;
    text-align: center;
    box-shadow: 0em 0.5em 4em -3em grey;

    // background-image: linear-gradient(to bottom right, $nav-dark, rgb(197, 112, 112), url("img/keramiker.png"));
  }
}

button {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  outline: none;
  text-decoration: none;
  display: flex;
  justify-content: center;
  align-items: center;
  cursor: pointer;
  text-transform: uppercase;
  opacity: 1;
  box-sizing: border-box;
  padding: 2em;
  border: 2px $nav-dark solid;
  background: none;

  a {
    color: $nav-dark;
    font-size: 2em;
    font-weight: 500;
    letter-spacing: 0.7px;
    text-decoration: none;

    animation: storm 0.7s ease-in-out;
    animation-delay: 0.06s;

    &:hover {
      animation: rotate 0.7s ease-in-out;
    }
  }
}
@keyframes rotate {
  0% {
    transform: rotate(0deg) translate3d(0, 0, 0);
  }
  25% {
    transform: rotate(3deg) translate3d(0, 0, 0);
  }
  50% {
    transform: rotate(-3deg) translate3d(0, 0, 0);
  }
  75% {
    transform: rotate(1deg) translate3d(0, 0, 0);
  }
  100% {
    transform: rotate(0deg) translate3d(0, 0, 0);
  }
}

@keyframes storm {
  0% {
    transform: translate3d(0, 0, 0) translateZ(0);
  }
  25% {
    transform: translate3d(4px, 0, 0) translateZ(0);
  }
  50% {
    transform: translate3d(-3px, 0, 0) translateZ(0);
  }
  75% {
    transform: translate3d(2px, 0, 0) translateZ(0);
  }
  100% {
    transform: translate3d(0, 0, 0) translateZ(0);
  }
}

