    font-size: 2em;
    font-family: $txt;
    font-weight: $light;
    text-align: center;
  }

  .vila {
    margin-left: 1.21em;
  }

  &__heading-span {
    padding: 0.1em 1em;
    -webkit-box-decoration-break: clone;
    box-decoration-break: clone;

    &--1 {
      background: #755252bd;
    }

    &--2 {
      background: #755252bd;
    }

    &--3 {
      background: #755252bd;
    }
  }

  &__details {
    padding: 3rem;

    ul {
      list-style: none;
      width: 80%;
      margin: 0 auto;

      li {
        text-align: center;
        font-size: 1.5rem;
        padding: 1rem;

        &:not(:last-child) {
          border-bottom: 1px solid black;
        }
      }
    }
  }

  //BACK SIDE STYLING
  &__info {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 90%;

    ul {
      line-height: 2;
    }

    h2 {
      text-align: center;
      font-weight: $light;
      font-size: 2em;
      padding-bottom: 1em;
    }
  }
}

